import { render } from '@testing-library/react';
import React from 'react';

const Login = () => {
  render();{
    return (
    <div className= "container-login">
        <form>
          <div className="input-field">
            <label>Email</label>
            <input  name="email" id="email" placeholder="Insira seu email" type="text" />
          </div>
          <div className="input-field">
            <label>Senha</label>
            <input type="text" />
          </div>
          <div>
            <label>Enviar</label>
            <input type="submit" />
          </div>
        </form>

    </div>
    
    )
  }
  
   
};

export default Login;
